import styled from 'styled-components';

export const Div = styled.div`
  margin-bottom: 15px;
`;

export const Label = styled.label`
  color: #000;
  font-size: 20px;
`;

export const Input = styled.input`
  width: 400px;
  padding: 10px;
  margin: 0 auto;
  border-radius: 4px;
  border: 3px solid #f08080;
`;
